import React from "react";
import Button from "@mui/material/Button";
import { RecoilRoot } from "recoil";

function App() {
  return (
    <RecoilRoot>
      <div>
        <Button variant="contained">Hello World</Button>
      </div>
    </RecoilRoot>
  );
}

export default App;
